import React, { Component } from 'react';
import logo from "../fitness.svg";
import "./App.css";

class navbar extends Component {
    render() {
        return (
          <div class="container">
            <img src={logo} className='App-logo' alt='logo' />
          </div>
        );
    }
}

export default navbar;
